import React from 'react';
import './TopHeaderBar.css';

const TopHeaderBar = () => {
  return (
    <div className="top-header-bar">
      <div className="contact-info">
        <span>T : +91 294 355 9969</span>
        <span>|</span>
        <span>E : abacusonlineclass2020@gmail.com</span>
      </div>
      <div className="social-icons">
        <a href="https://wa.me/919876543210" target="_blank" rel="noopener noreferrer" aria-label="WhatsApp">
          <img src="/images/whatsapp-icon.png" alt="WhatsApp" />
        </a>
        <a href="https://facebook.com/abacusonlineacademy" target="_blank" rel="noopener noreferrer" aria-label="Facebook">
          <img src="/images/facebook-icon.png" alt="Facebook" />
        </a>
        <a href="https://instagram.com/abacusonlineacademy" target="_blank" rel="noopener noreferrer" aria-label="Instagram">
          <img src="/images/instagram-icon.png" alt="Instagram" />
        </a>
      </div>
    </div>
  );
};

export default TopHeaderBar;
